          </div>
          <div className='endpoint'>
            <p>POST</p>
            <p>/something</p>
            <p>requested Number</p>
          </div>
          <div className='endpoint'>
            <p>POST</p>
            <p>/something</p>
            <p>requested Number</p>
          </div>
          <div className='endpoint'>
            <p>DELETE</p>
