            <p>requested Number</p>
          </div>
          <div className='endpoint'>
            <p>DELETE</p>
            <p>/something</p>
            <p>requested Number</p>
          </div>
        </>
      ) : (
        <></>
      )}
    </HomeStyled>
  );
}

const HomeStyled = styled.div`
  .endpoint {
    display: grid;
    grid-template-columns: 1fr 1fr 1fr;
  }
`;

export default Home;
